import Card from "./components/card";
import { trekData } from "./trekInfo";

function App() {
  return (
    <>
      <h2 className=" text-3xl font-bold">Upcoming Treks</h2>
      <div className="flex flex-row">
        {trekData.map((item) => (
          <Card key={item.id} data={item} />
        ))}
      </div>
    </>
  );
}

export default App;
